def get(name: str):
    image = BytesIO(base64.b64decode(pic[name]))
    image = Image.open(image)
    image = image.convert('RGBA')
    alpha = image.split()[3]
    bgmask = alpha.point(lambda x: 255-x)
    image.paste((255, 255, 255), None, bgmask)
    image = ImageQt.ImageQt(image)
    return image
